### 4.1 Model Architecture

For GIFFLAR, we used an architecture similar to Graph Isomorphism Networks [31] and instantiated Equation 7 as

$$
\begin{aligned}
\mathbf{h}_{x}^{l+1} & =\sum_{\mathcal{N}_{k} \in \mathcal{N}} \theta_{\mathcal{N}_{k}}^{l}\left((1+\epsilon) \cdot \mathbf{h}_{x}^{l}+\sum_{y \in \mathcal{N}_{k}} \mathbf{h}_{y}^{l}\right), \text { with } \\
\mathcal{N} & =\left\{\mathcal{B}_{0,0}, \mathcal{B}_{1,1}, \mathcal{B}_{2,2}, \mathcal{N}_{0,1}^{\mathrm{T}}, \mathcal{N}_{1,2}^{\mathrm{L}}\right\}
\end{aligned}
$$

and $\theta_{k}^{l}$ consisting of a fully connected layer, a parameterized ReLU activation function, dropout with $p=0.2$, and batch normalization. This architecture is shared across layers $l$ and neighborhoods $\mathcal{N}_{k}$, but not the weights. The readout for the final graph embedding is a simple mean over all nodes. We explored other approaches, which did not result in higher performance (see Appendix B). The classification head is a simple, two-layered MLP with a parameterized ReLU activation function and a dropout layer $(p=0.2)$. The final model takes 128 -dimensional node features as input. We use fixed, random embeddings per node class, e.g., C or O for atom nodes. The feature vectors are scaled up to 1024-dimensional embeddings in the hidden layers. As a result, the model has 35.1M trainable parameters.

For the prediction of the lectin-glycan interactions, we pair the glycan encoder with a protein encoder to embed the lectins. We tested four protein language models (PLMs), namely ESM-2 t33[32], Ankh-base[33], ProtBERT[34], and ProstT5[35]. For the prediction model, we used the protein encoders to compute fixed protein embeddings and trained GIFFLAR or SweetNet from scratch.
